Dear (Owner Name)

I wanted to take a moment and give you an update on your lease space at {Business full address}.  Your space has been listed on our website for {DOM} days.

From our marketing efforts, this lease space has been viewed {total view all sources} times.  We have interacted on {Buyer Note count} occasions with potential tenants on this location.  We have {Listing Signed CAs} signed confidentiality agreements and are in discussions with the potential tenants listed below.  Please confirm none of these candidates have reached out to you directly regarding the space.

{Insert CA Buyer Name}

As a follow up, please be sure to let me know if this space has been leased through your efforts so I can remove the listing.  In addition, be sure and let me know of any other second-generation space that could be a good fit for our clients.

Thank you so much and I look forward to finding you a qualified tenant.

{Office agent name}
{Office agent phone}
{Insert Selling Agent Email}
